import React, { Component } from 'react';
import axios from 'axios';



export default class TotalData extends Component {
    constructor() {
        super();
        this.state = {
            totalData: []
        }
    }
    componentDidMount() {
        axios.get('https://nepalcorona.info/api/v1/data/nepal')
            .then(res => {
                this.setState({
                    totalData: res.data
                })
            })
    }
    render() {
        console.log("final data>>", this.state);
        return (
            <div>
                <h2>Hellow</h2>


            </div>
        )
    }

}
